import React from 'react';

function Usage() {
  return (
    <div className="w-full flex flex-col items-center justify-center p-8">
      <svg className="w-16 h-16 text-gray-400 mb-4" fill="currentColor" viewBox="0 0 20 20" xmlns="http://www.w3.org/2000/svg">
        <path d="M2 10a8 8 0 018-8v8h8a8 8 0 11-16 0z" />
        <path d="M12 2.252A8.014 8.014 0 0117.748 8H12V2.252z" />
      </svg>
      <h2 className="text-2xl font-bold text-gray-800 mb-2">Usage</h2>
      <p className="text-gray-600 text-center">Coming soon! View your productivity stats and analytics.</p>
    </div>
  );
}

export default Usage;
